The new foundation by @smashboxisrael ... well, I tried it and loved it ! 
From my first try I can tell you a few things... full cover, can be very light and soft on the face but you have to mix it with a lot of moisturizer! Loved the colors - very Israeli skin tone. 
Over all very good first impression. 
USING all @smashboxcosmetics products... NEW STUDIO SKIN FULL COVERAGE BY @SMASHBOXISRAEL 
